INSERT INTO `v1_5a7ce25ba85a1664e54a55c754a731464ff483da7f20b566c4e22f8eddf8bf73` VALUES (0.75, 6, 11601, 1, "ツムギのボトルキャップ", 0.625, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。");
